import React,{Component} from "react";
import {Div0,SideBarDiv,ContentDiv,DataInfoChooseDiv,DataInfoDiv,DataDrawDiv,DataListDiv} from'./sty';
import SideBar from "../../common/sideBar/index";
class NewMainPage extends Component{
    render(){
        return (
                <Div0>
                    <SideBarDiv><SideBar></SideBar></SideBarDiv>
                    <ContentDiv>
                        <DataInfoDiv></DataInfoDiv>
                        <DataDrawDiv></DataDrawDiv>
                        <DataListDiv></DataListDiv>
                    </ContentDiv>
                </Div0>
        )}}
export default NewMainPage;
